query.query:
query {
  authoritativeSets(after: "cursor123' OR '1'='1") {
    items {
      id
      name
      identifier
    }
  }
}

query {
  authoritativeSets(from: "<script>alert('xss')</script>") {
    items {
      id
      name
      description
    }
  }
}

query {
  authoritativeSets(from: "http://169.254.169.254/latest/meta-data/iam/security-credentials/") {
    items {
      id
      name
      links {
        id
        type
      }
    }
  }
}

query {
  authoritativeSets(after: "1; cat /etc/passwd;") {
    items {
      id
      name
      description
    }
  }
}

query {
  authoritativeSets(from: "../../../../etc/passwd") {
    items {
      id
      name
      description
    }
  }
}

query {
  authoritativeSets(after: "<div onclick=\"alert(1)\">click</div>") {
    items {
      id
      name
      description
    }
  }
}

query {
  authoritativeSets(first: 5) {
    items {
      id
      name
      itemCount
      authorities {
        items {
          id
          type
          description {
            name
          }
        }
      }
    }
  }
}

query {
  s: authoritativeSets(first: 5) {
    items {
      id
      name
      itemCount
      authorities {
        items {
          id
          type
          description {
            name
          }
        }
      }
    }
  }
}

query {
  authoritativeSets(first: 1) {
    items {
      id
      __typename
    }
  }
  __type(name: "AuthoritativeSet") {
    name
    fields {
      name
      type {
        name
      }
    }
  }
}

query {
  authoritativeSets(name: "AuthoritativeSet") {
    fields {
      name
    }
  }
  authoritativeSets(first: 2) {
    items {
      id
      name
    }
  }
}

query {
  authoritativeSets(first: 3, after: "cursorA1") {
    items {
      id
      type
      identifier
      name
      description
      itemCount
    }
    pageInfo {
      hasNextPage
      nextPage
    }
  }
}
